import React, { useEffect } from "react";
import axios from "axios";
const ChatPage = () => {
  const fetchChats = async () => {
    const data = await axios.get("/api/chats");
    console.log(data);
  };
  useEffect(() => {
    fetchChats();
  }, []);
};

export default ChatPage;
